import React, {Component} from 'react';
import {Form, Input} from "antd";

class Sign extends Component {
    render() {
        return (
            <div>
                <h2>企业用户注册</h2>
                <Form name='register' scrollToFirstError>
                    <Form.Item name='orgCode' label='组织机构代码'>
                        <Input/>
                    </Form.Item>
                </Form>
            </div>
        );
    }
}

export default Sign;
